(1, 'cudo2qfpbxms027-c4ca4238a0b923820dcc509a6f75849b-5ed4aede8bcea', '#include<bits/stdc++.h>\nusing namespace std;\ntypedef long long ll;\n\n\nvoid solve(){\n\n    ll a,b,ans;\n    cin >> a >> b;\n    ans=a+b;\n    cout << ans << \"\\n\";\n\n}\n\nint main()\n{\n    //freopen(\"input.txt\",\"r\",stdin);\n    //freopen(\"output.txt\",\"w\",stdout);\n    ll t,i;\n    cin >> t;\n    for(i=0; i<t; i++)solve();\n\n\n    return 0;\n}\n', 2, 2, 128000, 0, 0, 3, '0', '2020-06-01 13:31:42'),
(2, 'qr0s8b758cuwudk-c81e728d9d4c2f636f067f89cc14862c-5ed4af1fa9429', '#include<bits/stdc++.h>\nusing namespace std;\ntypedef long long ll;\n\n\nvoid solve(){\n\n    ll a,b,ans;\n    cin >> a >> b;\n    ans=a+b;\n    cout << ans << \"\\n\";\n\n}\n\nint main()\n{\n    //freopen(\"input.txt\",\"r\",stdin);\n    //freopen(\"output.txt\",\"w\",stdout);\n    ll t,i;\n    cin >> t;\n    for(i=0; i<t; i++)solve();\n\n\n    return 0;\n}\n', 2, 2, 128000, 0, 0, 3, '0', '2020-06-01 13:32:47'),
(3, 'p84yx654c1m7wc5-eccbc87e4b5ce2fe28308fd9f2a7baf3-5ed4b2870b6a7', '#include<bits/stdc++.h>\r\nusing namespace std;\r\ntypedef long long ll;\r\n\r\n\r\nvoid solve(){\r\n\r\n    ll a,b,ans;\r\n    cin >> a >> b;\r\n    ans=a+b+3;\r\n    cout << ans << \"\\n\";\r\n\r\n}\r\n\r\nint main()\r\n{\r\n    //freopen(\"input.txt\",\"r\",stdin);\r\n    //freopen(\"output.txt\",\"w\",stdout);\r\n    ll t,i;\r\n    cin >> t;\r\n    for(i=0; i<t; i++)solve();\r\n\r\n\r\n    return 0;\r\n}\r\n', 2, 2, 128000, 0, 0, 3, '0', '2020-06-01 13:47:18'),
(4, 'qw66et3qc66jk1e-a87ff679a2f3e71d9181a67b7542122c-5ed4b6e6ca929', '#include<bits/stdc++.h>\nusing namespace std;\ntypedef long long ll;\n\n\nvoid solve(){\n\n    ll a,b,ans;\n    cin >> a >> b;\n    ans=a+b+4;\n    cout << ans << \"\\n\";\n\n}\n\nint main()\n{\n    //freopen(\"input.txt\",\"r\",stdin);\n    //freopen(\"output.txt\",\"w\",stdout);\n    ll t,i;\n    cin >> t;\n    for(i=0; i<t; i++)solve();\n\n\n    return 0;\n}\n', 2, 2, 128000, 2.305, 0, 3, '0', '2020-06-01 14:05:58'),
(5, '8sj5wxoty2lj165-e4da3b7fbbce2345d7772b0674a318d5-5ed4b730d057e', '#include<bits/stdc++.h>\nusing namespace std;\ntypedef long long ll;\n\n\nvoid solve(){\n\n    ll a,b,ans;\n    cin >> a >> b;\n    ans=a+b;\n    cout << ans << \"\\n\";\n\n}\n\nint main()\n{\n    //freopen(\"input.txt\",\"r\",stdin);\n    //freopen(\"output.txt\",\"w\",stdout);\n    ll t,i;\n    cin >> t;\n    for(i=0; i<t; i++)solve();\n\n\n    return 0;\n}\n', 2, 2, 128000, 0.006, 0, 3, '0', '2020-06-01 14:07:12'),
(6, 'm7nx450daft3lo7-1679091c5a880faf6fb5e6087eb1b2dc-5ed4b87c627a9', '#include<bits/stdc++.h>\nusing namespace std;\ntypedef long long ll;\n\n\nvoid solve(){\n\n    ll a,b,ans;\n    cin >> a >> b;\n    ans=a+b;\n    cout << ans << \"\\n\";\n\n}\n\nint main()\n{\n    //freopen(\"input.txt\",\"r\",stdin);\n    //freopen(\"output.txt\",\"w\",stdout);\n    ll t,i;\n    cin >> t;\n    for(i=0; i<t; i++)solve();\n\n\n    return 0;\n}\n', 2, 2, 128000, 0.006, 0, 3, '0', '2020-06-01 14:12:44'),
(7, 'rlj339wrtw1fzng-8f14e45fceea167a5a36dedd4bea2543-5ed4b8bb8eee7', '#include<bits/stdc++.h>\n#define MAX 30007\nusing namespace std;\ntypedef long long ll;\n \nvector<ll>t[4*MAX];\nll in[MAX];\n \nvoid build(ll n,ll l,ll r)\n{\n    if(l==r)\n    {\n        t[n].push_back(in[l]);\n        return;\n    }\n    ll mid=(l+r)/2;\n    build(n*2,l,mid);\n    build(n*2+1,mid+1,r);\n    merge(t[n*2].begin(),t[n*2].end(),t[n*2+1].begin(),t[n*2+1].end(),back_inserter(t[n]));\n}\n \nll query(ll node,ll l,ll r,ll i,ll j,ll k)\n{\n    if(l>j || r<i)return 0;\n    if(l>=i && r<=j)\n    {\n        ll low=lower_bound(t[node].begin(),t[node].end(),k)-t[node].begin();\n        ll up=upper_bound(t[node].begin(),t[node].end(),k)-t[node].begin();\n        return up-low;\n    }\n    ll mid=(l+r)/2;\n    return query(node*2,l,mid,i,j,k)+query(node*2+1,mid+1,r,i,j,k);\n}\n \nint main()\n{\n \n    ll n,i,a,sum=0,ans=0,b;\n    cin >> a;\n   cout << a << \"\\n\";\n \n \n    return 0;\n}', 2, 1.4, 12800, 0.013, 0, 3, '0', '2020-06-01 14:13:47'),
