(55, '4fnn23orzhh6mp9-b53b3a3d6ab90ce0268229151c9bde11-5ed4cb68066d8', '#include<bits/stdc++.h>\ntypedef long long int ll;\ntypedef unsigned long long int ull;\n#define BIG_NUM 2000000000\n#define HUGE_NUM 99999999999999999\n#define MOD 1000000007\n#define EPS 0.000000001\nusing namespace std;\n\n\n\nint N,num_query;\nvector<int> V;\n\nint main(){\n\n scanf(\"%d\",&N);\n\n int tmp;\n  for(int i = 0; i < N; i++){\n\n   scanf(\"%d\",&tmp);\n   V.push_back(tmp);\n }\n\n scanf(\"%d\",&num_query);\n\n int L,R,mid;\n  int left,right;\n\n for(int loop = 0; loop < num_query; loop++){\n\n    scanf(\"%d\",&tmp);\n\n   L = 0,R = N-1,mid = (L+R)/2;\n    left = N;\n\n   while(L <= R){\n\n      if(V[mid] >= tmp){\n\n        left = mid;\n       R = mid-1;\n      }else{\n\n        L = mid+1;\n      }\n     mid = (L+R)/2;\n    }\n\n   L = 0,R = N-1,mid = (L+R)/2;\n    right = N;\n\n    while(L <= R){\n\n      if(V[mid] > tmp){\n\n       right = mid;\n        R = mid-1;\n      }else{\n\n        L = mid+1;\n      }\n     mid = (L+R)/2;\n    }\n\n   printf(\"%d %d\\n\",left,right);\n  }\n\n return 0;\n}', 2, 2, 128000, 0.006, 0, 4, '0', '2020-06-01 15:33:27'),
