(64, 'behhdxrka50thcu-ea5d2f1c4608232e07d3aa3d998e5135-5ed4d83cbf21e', '#include<bits/stdc++.h>\ntypedef long long int ll;\ntypedef unsigned long long int ull;\n#define BIG_NUM 2000000000\n#define HUGE_NUM 99999999999999999\n#define MOD 1000000007\n#define EPS 0.000000001\nusing namespace std;\n\n\n\nint N,num_query;\nvector<int> V;\n\nint main(){\n\n scanf(\"%d\",&N);\n\n int tmp;\n  for(int i = 0; i < N; i++){\n\n   scanf(\"%d\",&tmp);\n   V.push_back(tmp);\n }\n\n scanf(\"%d\",&num_query);\n\n int L,R,mid;\n  int left,right;\n\n for(int loop = 0; loop < num_query; loop++){\n\n    scanf(\"%d\",&tmp);\n\n   L = 0,R = N-1,mid = (L+R)/2;\n    left = N;\n\n   while(L <= R){\n\n      if(V[mid] >= tmp){\n\n        left = mid;\n       R = mid-1;\n      }else{\n\n        L = mid+1;\n      }\n     mid = (L+R)/2;\n    }\n\n   L = 0,R = N-1,mid = (L+R)/2;\n    right = N;\n\n    while(L <= R){\n\n      if(V[mid] > tmp){\n\n       right = mid;\n        R = mid-1;\n      }else{\n\n        L = mid+1;\n      }\n     mid = (L+R)/2;\n    }\n\n   printf(\"%d %d\\n\",left,right);\n  }\n\n return 0;\n}', 2, 2, 128000, 0.12, 0, 3, '0', '2020-06-01 16:28:12'),
(65, '8uy1msa1ka7e5mw-fc490ca45c00b1249bbe3554a4fdf6fb-5ed5207447dee', '#include<bits/stdc++.h>\n#define MAX 30007\nusing namespace std;\ntypedef long long ll;\n \nvector<ll>t[4*MAX];\nll in[MAX];\n \nvoid build(ll n,ll l,ll r)\n{\n    if(l==r)\n    {\n        t[n].push_back(in[l]);\n        return;\n    }\n    ll mid=(l+r)/2;\n    build(n*2,l,mid);\n    build(n*2+1,mid+1,r);\n    merge(t[n*2].begin(),t[n*2].end(),t[n*2+1].begin(),t[n*2+1].end(),back_inserter(t[n]));\n}\n \nll query(ll node,ll l,ll r,ll i,ll j,ll k)\n{\n    if(l>j || r<i)return 0;\n    if(l>=i && r<=j)\n    {\n        ll low=lower_bound(t[node].begin(),t[node].end(),k)-t[node].begin();\n        ll up=upper_bound(t[node].begin(),t[node].end(),k)-t[node].begin();\n        return up-low;\n    }\n    ll mid=(l+r)/2;\n    return query(node*2,l,mid,i,j,k)+query(node*2+1,mid+1,r,i,j,k);\n}\n \nint main()\n{\n \n    ll n,i,a,sum=0,ans=0,b;\n    cin >> a;\n   cout << a << \"\\n\";\n \n \n    return 0;\n}', 2, 0.1, 12800, 0.119, 0, 5, '0', '2020-06-01 21:36:20'),
