(493, 'spbmfvxe0wfelzy-2f55707d4193dc27118a0f19a1985716-5f1a733e584e1', '#include<bits/stdc++.h>\n#define MAX 30007\nusing namespace std;\ntypedef long long ll;\n \nvector<ll>t[4*MAX];\nll in[MAX];\n \nvoid build(ll n,ll l,ll r)\n{\n    if(l==r)\n    {\n        t[n].push_back(in[l]);\n        return;\n    }\n    ll mid=(l+r)/2;\n    build(n*2,l,mid);\n    build(n*2+1,mid+1,r);\n    merge(t[n*2].begin(),t[n*2].end(),t[n*2+1].begin(),t[n*2+1].end(),back_inserter(t[n]));\n}\n \nll query(ll node,ll l,ll r,ll i,ll j,ll k)\n{\n    if(l>j || r<i)return 0;\n    if(l>=i && r<=j)\n    {\n        ll low=lower_bound(t[node].begin(),t[node].end(),k)-t[node].begin();\n        ll up=upper_bound(t[node].begin(),t[node].end(),k)-t[node].begin();\n        return up-low;\n    }\n    ll mid=(l+r)/2;\n    return query(node*2,l,mid,i,j,k)+query(node*2+1,mid+1,r,i,j,k);\n}\n \nint main()\n{\n \n    ll n,i,a,sum=0,ans=0,b;\n    cin >> a;\n   cout << a << \"\\n\";\n \n \n    return 0;\n}', 3, 2, 12800, 0.012, 0, 3, '5f1a733f358e2', '2020-07-24 11:35:58'),
